%pyspark

def agg_count_by_col_values(input_col, values, output_cols):
    return [
        sum(when(col(input_col) == value, lit(1)).otherwise(lit(0))).alias(output_col)
        for value, output_col in zip(values, output_cols)
    ]

def rate_projection(rate, p):
    r = int(rate * 100)
    r = r - (r % p)
    return float(r) / 100

rate_projection_udf = udf(rate_projection, DoubleType())
